import React from 'react';
import styled from 'styled-components';

function ArticleCompany() {
	return (
		<ComponentWrapper>
			<div className="Card_card__container__7W4Fx">
				<a href="/company/16591" className="">
					<header
						role="img"
						style={{
							backgroundImage:
								'url("https://static.wanted.co.kr/images/company/16591/jhuho8jydkg5mnvx__400_400.jpg")',
						}}
					/>
					<div className="Card_card__body__rie2K">
						<div className="Card_card__body_flexbox__blYGd">
							<div
								role="img"
								className="Card_card__body_img__dH9x1"
								style={{
									backgroundImage:
										'url("https://static.wanted.co.kr/images/wdes/0_5.e57021b5.jpg")',
								}}
							/>
							<div className="Card_card__body_info__8f_bM">
								<p className="Card_card__body_info_title__e5_Il">
									노바트라
								</p>
								<p className="Card_card__body_info_location__tXo2O">
									판매, 유통
								</p>
							</div>
						</div>
						<button
							type="button"
							className="Button_Button__root__V1ie3 Button_Button__outlined__H2mkd undefined Button_Button__sizeMedium__k0A1w Card_card__body_btn__68NON"
						>
							<span className="Button_Button__label__1Kk0v">
								팔로우
							</span>
						</button>
					</div>
				</a>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	.Card_card__container__7W4Fx {
		padding: 10px;
		> a {
			display: block;
		}
		header {
			padding-bottom: 52%;
			background-size: cover;
			background-position: 50%;
			border-radius: 4px;
			-webkit-box-shadow: inset 0 0 0 1px rgb(0 0 0 / 10%);
			box-shadow: inset 0 0 0 1px rgb(0 0 0 / 10%);
		}
	}
`;
export default ArticleCompany;
